import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply Price Sort Filter
    await page.waitForSelector('select.search-category', { timeout: 5000 });
    await page.selectOption('select.search-category', 'Electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_selected_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_selected_category.png'));

    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    await page.waitForSelector('select.sort-filter', { timeout: 5000 });
    await page.selectOption('select.sort-filter', 'price-low');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sorted.png'));

    return {
      success: true,
      action: "Applied price sort filter and navigated through the results",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
